import { Row, Col } from 'react-bootstrap';
import products from '../products'; // Assuming '../products' is the correct relative path

function HomeScreen() {
  return (
    <>
        <h1>Latest Products</h1>
        <Row>
            {products.map((product) => (
              <h3>{product.name}</h3>    
            ))}
        </Row> 
    </>
  );
}

export default HomeScreen;
